import styled from 'styled-components';


const VideoGalleryStyle = styled.div`
background-color: #0F1C51
    img{
        width:100%;
        object-fit:cover;
        position:relative;
    }
    .play{ 
        position:absolute;
        z-index:1;
        left: 25%;
        display: flex;
        align-items: center;
    }
    .text{
        display: flex;
        flex-direction: column;
    }
    .title{
        display: flex;
        align-items: center;
        justify-content: center;
        white-space: nowrap;
        writing-mode: vertical-lr;
        transform: rotate(180deg);
    }
    .global{
        display:flex;
    }




    @media only screen and (min-width:415px) and (max-width:768px){

    }
    @media only screen and (min-width:769px) {
        h1{
            margin-bottom:2.5%;
        }
        .colum1, .colum2{
            width:46%
        }
        img{
            height:90vh;
        }
        .title{
            width:8%;
            white-space: nowrap;
            writing-mode: vertical-lr;
            transform: rotate(180deg);
        }
        .text{
            width: 80%;
            min-height: 90vh;
            justify-content: center;
        }

    }

`;

export { VideoGalleryStyle };
